import React from 'react'
import  './App.css'
import Typewriter from 'typewriter-effect';

function App() {
  return (
    <div className="typing">
      <Typewriter
        options={{
        strings: [
          'Web Developer', 
          'UX Designer'
        ],
        typewriter__cursor:'blink',
        autoStart: true,
        loop: true,
        delay:4
        }}
      />
    </div>
  )
}

export default App
